column.Comment:
自检结果概览，格式如下：
            {
            "itemCategorys": [{
            		"itemCategory": "1,2",
            		"itemCategoryName": "科技管理",
            		"uncompletedCount" "12"
            		},{
            		"itemCategory": "3",
            		"itemCategoryName": "机房环境"
            		"uncompletedCount" "-1"//-1--标识已完成
            		},…]
            }

单次提醒格式如下：
            {
            "singleTime":"2017-03-06 12:00:00"
            }
            设置单次提醒时间精确到分钟
            
            循环提醒格式如下：
            {
            "circleType":"everyMonth",//everyMonth-每月,everyDay-每天,everyWeek-每周
            "circleItem":"1",//circleTime为每月的时，表示每月的几号；circleTime为每周的时，表示每周的周几；circleDay为每天的时，该项不存在值
            "circleTime":"20:00:00"//具体到某天的执行时间
            }
